import React from "react";
import Navbar from "./Navbar";
import Footer from "./Footer";
import Component from "./Component";

function App() {
  return (
    <div className="app-div">
      <Navbar />

      <img className="app-shop" src="main.jpg" alt="main" />

      <div className="app-shoes">
        <h1>Nike shoes</h1>
        <Component />
        <h1>Nike shoes</h1>
        <Component />
        <h1>Nike shoes</h1>
        <Component />
        <h1>Nike shoes</h1>
        <Component />
        <h1>Nike shoes</h1>
        <Component />
      </div>

      <div>
        <Footer />
      </div>
    </div>
  );
}

export default App;
